import React, { useState } from 'react';
import { Radio, Space, Form } from 'antd';

export default function RadioInput({opcoes}){
    return(
            <Radio.Group>
                <Space direction="vertical">
                    {opcoes.map((opcao) =>
                        <Radio value={opcao}>{opcao}</Radio>
                    )}
                </Space>
            </Radio.Group>
    );
}
